import React, { useState, useEffect } from 'react';

const PresetModal = ({ onClose, onSave, editingPreset, groups }) => {
  const [formData, setFormData] = useState({
    name: '',
    description: '',
    command: '',
    group_ids: []
  });

  useEffect(() => {
    if (editingPreset) {
      setFormData({
        name: editingPreset.name,
        description: editingPreset.description || '',
        command: editingPreset.command,
        group_ids: editingPreset.group_ids || []
      });
    }
  }, [editingPreset]);

  const handleSubmit = (e) => {
    e.preventDefault();
    onSave(formData);
    onClose();
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleGroupChange = (groupId) => {
    setFormData(prev => ({
      ...prev,
      group_ids: prev.group_ids.includes(groupId)
        ? prev.group_ids.filter(id => id !== groupId)
        : [...prev.group_ids, groupId]
    }));
  };

  const getTotalClientsInGroups = (groupIds) => {
    const clientSet = new Set();
    groupIds.forEach(groupId => {
      const group = groups.find(g => g.id === groupId);
      if (group && group.client_ids) {
        group.client_ids.forEach(clientId => clientSet.add(clientId));
      }
    });
    return clientSet.size;
  };

  return (
    <div className="modal" onClick={onClose}>
      <div className="modal-content" onClick={e => e.stopPropagation()}>
        <div className="modal-header">
          <h3>{editingPreset ? '프리셋 편집' : '새 프리셋 만들기'}</h3>
          <span className="close" onClick={onClose}>&times;</span>
        </div>
        
        <div className="modal-body">
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label htmlFor="presetName">프리셋 이름</label>
              <input 
                type="text" 
                id="presetName" 
                name="name"
                className="form-input" 
                placeholder="예: 메인 콘텐츠" 
                value={formData.name}
                onChange={handleChange}
                required 
              />
              <small className="form-help">알아보기 쉬운 프리셋 이름</small>
            </div>
            
            <div className="form-group">
              <label htmlFor="presetDescription">설명 (선택)</label>
              <textarea 
                id="presetDescription" 
                name="description"
                className="form-input" 
                rows="2" 
                placeholder="프리셋에 대한 설명을 입력하세요"
                value={formData.description}
                onChange={handleChange}
              />
            </div>
            
            <div className="form-group">
              <label htmlFor="presetCommand">언리얼엔진 실행 명령</label>
              <textarea 
                id="presetCommand" 
                name="command"
                className="form-input" 
                rows="6" 
                placeholder="D:\UnrealProjects\MyProject\Windows\MyProject.exe None -messaging -dc_cluster -nosplash -dc_cfg=&quot;C:\path\to\config.ndisplay&quot; -dc_node=Node_0 -fullscreen" 
                value={formData.command}
                onChange={handleChange}
                required 
              />
              <small className="form-help">스위치보드에서 생성된 전체 명령어를 복사해서 붙여넣으세요. 매우 긴 명령어도 지원됩니다.</small>
            </div>
            
            <div className="form-group">
              <label>대상 그룹 선택 (복수 선택 가능)</label>
              <div className="checkbox-group">
                {groups.length === 0 ? (
                  <div style={{ textAlign: 'center', padding: '20px', color: 'var(--text-muted)' }}>
                    먼저 그룹을 생성해주세요
                  </div>
                ) : (
                  groups.map(group => (
                    <label key={group.id} className="checkbox-label">
                      <input 
                        type="checkbox" 
                        checked={formData.group_ids.includes(group.id)}
                        onChange={() => handleGroupChange(group.id)}
                      />
                      <span>{group.name} ({(group.client_ids || []).length}개 클라이언트)</span>
                    </label>
                  ))
                )}
              </div>
              <small className="form-help">
                이 프리셋을 실행할 그룹을 선택하세요. 선택한 그룹의 모든 클라이언트에서 실행됩니다.
                {formData.group_ids.length > 0 && (
                  <span style={{ color: '#22c55e' }}>
                    총 {getTotalClientsInGroups(formData.group_ids)}대 클라이언트에서 실행됩니다.
                  </span>
                )}
              </small>
            </div>
            
            <div className="modal-actions">
              <button type="button" className="btn btn-secondary" onClick={onClose}>취소</button>
              <button type="submit" className="btn btn-primary">저장</button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default PresetModal;
